import React from 'react';
import Pageadmin from 'layouts/page-admin';
import Select from 'react-select';



class Index extends React.Component{

    render(){
        const data  = [
            { value1: 'chocolate', labell: 'Chocolate' },
            { value1: 'strawberry', labell: 'Strawberry' },
            { value1: 'vanilla', labell: 'Vanilla' }
          ];
        const options = [
            { value1: 'chocolate', labell: 'Chocolate' },
            { value1: 'strawberry', labell: 'Strawberry' },
            { value1: 'vanilla', labell: 'Vanilla' }
          ];
        return(
            <Pageadmin>
                
                <div style={{ height: '500px'}}>
                    <h1 className='display-1 text-center'>Midas</h1>
                    <h1 className='display-2 text-center'>Mustikatama Document Archive System</h1>
                </div>
                <Select options={options} defaultValue={options}/>
            </Pageadmin>
        )
    }
}


export default Index;
